import React from 'react'
import "./Home.css"
import { Hero } from '../Hero';

function Home() {
  return (
    <>
        <video id="video-bg" autoPlay muted loop>
            <source src="/Videos/Vid.mp4" type="video/mp4" />
        </video>
        <Hero MainTextOut=""/>
        

    </>
  )
}

export default Home;
